--
-- Create procedure `Proc_fixed_asset_Update`
--
CREATE PROCEDURE Proc_fixed_asset_Update (IN $fixed_asset_name varchar(255), IN $fixed_asset_code varchar(50), IN $department_id char(36), IN $department_name varchar(255), IN $department_code varchar(50), IN $fixed_asset_category_id char(36), IN $fixed_asset_category_name varchar(255), IN $fixed_asset_category_code varchar(50), IN $purchase_date timestamp, IN $cost decimal(19, 4), IN $quantity int, IN $depreciation_rate float, IN $tracked_year int, IN $life_time int, IN $production_year int, IN $active bit, IN $created_by varchar(50), IN $created_date timestamp, IN $modified_by varchar(50), IN $modified_date timestamp, IN $fixed_asset_id char(36), IN $start_using_date datetime, IN $depreciation_value_year decimal(19, 4), IN $accumulated_depreciation decimal(19, 4), IN $remaining_value decimal(19, 4), IN $budget longtext)
SQL SECURITY INVOKER
BEGIN
  -- Store sửa tài sản cũ
  -- Created by vtahoang 27.07.2023
  -- Call Proc_fixed_asset_Update('test', 'TS00500', '59d19422-6657-452e-a7db-e5d54223c257', 'Phòng kinh doanh và tiếp thị', 'KDTT', '3e9ce051-3625-11ee-a2e3-d45d64601179', 'Máy in', 'MI', NULL, NULL, NULL, NULL, NULL, NULL, NULL, null, NULL, NULL, NULL, NULL, 'dd13594b-36d6-11ee-a2e3-d45d64601179', NULL, NULL, NULL, NULL)
  DECLARE temp_ref_id char(36);
  DECLARE temp_cost decimal(19, 4);

  -- Cập nhật bảng fixed_asset
  UPDATE fixed_asset fa
  SET fixed_asset_code = $fixed_asset_code,
      fixed_asset_name = $fixed_asset_name,
      department_id = $department_id,
      department_code = $department_code,
      department_name = $department_name,
      fixed_asset_category_id = $fixed_asset_category_id,
      fixed_asset_category_code = $fixed_asset_category_code,
      fixed_asset_category_name = $fixed_asset_category_name,
      start_using_date = $start_using_date,
      purchase_date = $purchase_date,
      cost = $cost,
      quantity = $quantity,
      depreciation_rate = $depreciation_rate,
      tracked_year = $tracked_year,
      life_time = $life_time,
      production_year = $production_year,
      modified_by = $modified_by,
      modified_date = $modified_date,
      start_using_date = $start_using_date,
      depreciation_value_year = $depreciation_value_year,
      accumulated_depreciation = $accumulated_depreciation,
      remaining_value = $remaining_value,
      fa.budget = $budget
  WHERE fa.fixed_asset_id = $fixed_asset_id;

  -- Cập nhật bảng detail ghi tăng
  UPDATE asset_increase_voucher_detail aivd
  SET aivd.fixed_asset_code = $fixed_asset_code,
      aivd.fixed_asset_name = $fixed_asset_name,
      aivd.department_name = $department_name,
      aivd.cost = $cost,
      aivd.depreciation_value_year = $depreciation_value_year,
      aivd.remaining_value = $remaining_value
  WHERE aivd.fixed_asset_id = $fixed_asset_id;

  -- Update tổng nguyên giá detail voucher
  SELECT
    ref_id INTO temp_ref_id
  FROM asset_increase_voucher_detail aivd
  WHERE aivd.fixed_asset_id = $fixed_asset_id;

  SELECT
    SUM(aivd.cost) INTO temp_cost
  FROM asset_increase_voucher_detail aivd
  WHERE aivd.ref_id = temp_ref_id;

  UPDATE asset_increase_voucher aiv
  SET aiv.total_cost = temp_cost
  WHERE aiv.ref_id = temp_ref_id;

END
$$

--
-- Create procedure `Proc_asset_increase_voucher_Update`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_asset_increase_voucher_Update (IN $ref_id char(36), IN $ref_no varchar(50), IN $ref_date datetime, IN $increase_date datetime, IN $note varchar(255), IN $created_by varchar(255), IN $created_date datetime, IN $modified_by varchar(255), IN $modified_date datetime, IN $total_cost decimal(19, 0))
BEGIN
  -- Store cập nhật chứng từ ghi tăng 
  -- Created by vtahoang 21.08.2023
  -- CALL Proc_asset_increase_voucher_Update('469b3ece-744a-45d5-957d-e8c757976496', 'test2', NULL, NULL, NULL, NULL, NULL, NULL, NULL)
  UPDATE asset_increase_voucher aiv
  SET ref_no = $ref_no,
      ref_date = $ref_date,
      increase_date = $increase_date,
      note = $note,
      modified_by = $modified_by,
      modified_date = $modified_date,
      aiv.total_cost = $total_cost
  WHERE aiv.ref_id = $ref_id;
  UPDATE asset_increase_voucher_detail aivd
  SET aivd.ref_no = $ref_no
  WHERE aivd.ref_id = $ref_id;
END
$$

