--
-- Create procedure `Proc_GetTotalRecords`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_GetTotalRecords (IN $where_condition varchar(500), IN $table varchar(255))
BEGIN
  -- Store đếm số bản ghi thoả mãn điều kiện
  -- Created by vtahoang 01.08.2023
  -- Call Proc_fixed_asset_GetTotalRecords('WHERE 1=1')
  SET @sql = CONCAT('SELECT COUNT(*)',
  ' FROM ', $table, ' ',
  IF($where_condition <> '', $where_condition, ' '));
  PREPARE statement FROM @sql;
  EXECUTE statement;
  DEALLOCATE PREPARE statement;
END
$$

--
-- Create procedure `Proc_GetFilter`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_GetFilter (IN $limit int, IN $offset int, IN $columns varchar(500), IN $sort_type varchar(255), IN $sort_field varchar(255), IN $where_condition varchar(500), IN $table varchar(255))
BEGIN
  -- Store lấy danh sách bản ghi theo bộ lọc
  -- Created by vtahoang 31.07.2023
  -- Call Proc_fixed_asset_GetFilter(20, 0, 'fixed_asset_id, fixed_asset_code', 'ASC', 'modified_date', 'WHERE 1=1')
  SET @sql = CONCAT('SELECT ', $columns,
  ' FROM ', $table, ' ',
  IF($where_condition <> '', $where_condition, ' '),
  ' ORDER BY ', $sort_field, ' ', $sort_type);
  IF $limit > 0 THEN
    SET @sql = CONCAT(@sql, ' LIMIT ', $limit, ' OFFSET ', $offset);
  END IF;
  PREPARE statement FROM @sql;
  EXECUTE statement;
  DEALLOCATE PREPARE statement;
END
$$

